import React from "react";
import { LabelsProps } from "../data/interfaces";
import { MyUsers } from "../data/users";
import { UserProps } from "../data/interfaces";

const mapDatas = MyUsers.map((data: UserProps, index) =>
    <p key={`id-${index}`}>{index} {data.name}</p>
);


const Homepage = ({loadingMessage, errorMessage} : LabelsProps) => {
    return(
        <>
            <p>This is my homepage</p>
            <p>{loadingMessage}</p>
            <p>{errorMessage}</p>

            {mapDatas}
        </>
    )
}

export default Homepage;
